style.css:
@-moz-document domain("flibusta.is"), domain("flibustahezeous3.onion.link") {
#primary ul li a, .sidebar .block h2, body, #page, #front, #second, #container, #header, #footer, #main, td, #divabio { background: #060708 !important; color: #990033 !important; }
td, ul.primary li a, .pager .pager-current, .pager a, .sticky, #mission, input, textarea, button { background: #060708 !important; color: #990033 !important; border: 1px solid #990033 !important; }
.pager .pager-current a, .pager a, a:link, .h8 { background: #060708 !important; color: #339933 !important; }
.pager .pager-current a:visited, .pager a:visited, a:visited { background: #060708 !important; color: #669900 !important; }
h3 { background: #060708 !important; color: #800000 !important; }
h8 { color: #90EE90 !important; }
.blockinner td, form td, #newann td { border: none !important; }
}
